Here's a basic outline of how you can create a Rust app that supports the elevenlabs.io API and reads the contents of the clipboard aloud using TTS:

**Step 1: Set up a new Rust project**

Create a new Rust project using `cargo`:
```bash
cargo new elevenlabs_tts
```
**Step 2: Add dependencies**

Add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.4"  // for making HTTP requests to the elevenlabs.io API
clipboard = "0.5.0"  // for accessing the clipboard
tts = "0.1.0"  // for text-to-speech functionality (we'll use the `tts` crate)
```
**Step 3: Implement API client**

Create a new file `api.rs` and add the following code:
```rust
use reqwest;

pub struct ElevenLabsApiClient {
    api_key: String,
}

impl ElevenLabsApiClient {
    pub fn new(api_key: String) -> Self {
        ElevenLabsApiClient { api_key }
    }

    pub async fn get_tts(&self, text: String) -> Result<String, reqwest::Error> {
        let url = format!("https://api.elevenlabs.io/v1/tts?text={}&voice=en-US", text);
        let response = reqwest::get(url).await?;
        let json = response.json::<serde_json::Value>().await?;
        Ok(json["audio_url"].as_str().unwrap().to_string())
    }
}
```
This code defines an `ElevenLabsApiClient` struct that takes an API key in its constructor. The `get_tts` method makes a GET request to the elevenlabs.io API with the provided text and returns the audio URL as a string.

**Step 4: Implement clipboard reader**

Create a new file `clipboard.rs` and add the following code:
```rust
use clipboard;

pub fn get_clipboard_text() -> Result<String, clipboard::Error> {
    clipboard::get_text()
}
```
This code defines a `get_clipboard_text` function that uses the `clipboard` crate to retrieve the contents of the clipboard.

**Step 5: Implement TTS player**

Create a new file `tts.rs` and add the following code:
```rust
use tts;

pub fn play_tts(audio_url: String) -> Result<(), tts::Error> {
    tts::play(audio_url)
}
```
This code defines a `play_tts` function that uses the `tts` crate to play the audio URL.

**Step 6: Main function**

Create a new file `main.rs` and add the following code:
```rust
use elevenlabs_tts::api;
use elevenlabs_tts::clipboard;
use elevenlabs_tts::tts;

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    let api_key = "YOUR_API_KEY_HERE";
    let api_client = api::ElevenLabsApiClient::new(api_key.to_string());

    let clipboard_text = clipboard::get_clipboard_text()?;
    let audio_url = api_client.get_tts(clipboard_text).await?;
    tts::play_tts(audio_url)?;

    Ok(())
}
```
This code defines the `main` function, which creates an instance of the `ElevenLabsApiClient`, retrieves the clipboard text, gets the audio URL from the API, and plays the audio using the `tts` crate.

